import React from "react";
import "./App.css";

import MyHeader from "./MyHeader";
import MyFooter from "./MyFooter";

function App() {
  let name = "hyejin";

  const style = {
    App: { backgroundColor: white },

    h2: { color: "red" },

    bold_text: { color: "greed" },
  };

  const func = () => {
    return "func";
  };

  return (
    <div style={style.App}>
      <MyHeader />
      <header className="App-header">
        <h2>안녕 리액트 {name}</h2>
      </header>
    </div>
  );
}

export default App;
